        private static Dictionary<string, string> py = new Dictionary<string, string>();
        private static Dictionary<char, string> yy = new Dictionary<char, string>();

        static PinYin()
        {
            try
            {
                yy.Add('ā', "a");
                yy.Add('á', "a");
                yy.Add('ǎ', "a");
                yy.Add('à', "a");
                yy.Add('ō', "o");
                yy.Add('ó', "o");
                yy.Add('ǒ', "o");
                yy.Add('ò', "o");
                yy.Add('ē', "e");
                yy.Add('é', "e");
                yy.Add('ě', "e");
                yy.Add('è', "e");
                yy.Add('ī', "i");
                yy.Add('í', "i");
                yy.Add('ǐ', "i");
                yy.Add('ì', "i");
                yy.Add('ū', "u");
                yy.Add('ú', "u");
                yy.Add('ǔ', "u");
                yy.Add('ù', "u");
                yy.Add('ǖ', "u");
                yy.Add('ǘ', "u");
                yy.Add('ǚ', "u");
                yy.Add('ǜ', "u");
                string[] temp = CityPinYin.Split(new char[] { ' ' }, StringSplitOptions.RemoveEmptyEntries);
                for (int i = 0; i < CityHanZi.Length; i++)
                {
                    if (!py.ContainsKey(CityHanZi[i].ToString()))
                        py.Add(CityHanZi[i].ToString(), temp[i]);
                }
            }
            catch { }
        }
        public static string ToPinYin(string chinese)
        {
            StringBuilder pinyin = new StringBuilder();
            for (int i = 0; i < chinese.Length; i++)
            {
                if (py.ContainsKey(chinese[i].ToString()))
                {
                    pinyin.Append(py[chinese[i].ToString()]);
                }
                else
                {
                    pinyin.Append(chinese[i]);
                }
                pinyin.Append(' ');
            }
            return pinyin.ToString();
        }
        public static string RemoveAttributeChars(string pinyin)
        {
            StringBuilder english = new StringBuilder();
            string[] array = pinyin.Split(new char[] { ' ' }, StringSplitOptions.RemoveEmptyEntries);
            foreach (var item in array)
            {
                if (yy.ContainsKey(item[0]))
                {
                    english.Append(yy[item[0]].ToUpper());
                }
                else
                {
                    english.Append(item[0]);
                    for (int i = 1; i < item.Length; i++)
                    {
                        if (yy.ContainsKey(item[i]))
                        {
                            english.Append(yy[item[i]]);
                        }
                        else
                        {
                            english.Append(item[i]);
                        }
                    }
                }
                english.Append(' ');
            }
            return english.ToString();
        }
        public static string Trim(string english)
        {
            return string.Join("", english.Split(new char[] { ' ' }));
        }
        public static string ToUpper(string english)
        {
            return english.ToUpper();
        }
        public static string ToLower(string english)
        {
            return english.ToLower();
        }
